export default ValidAccount = async (data) => {
    try {
        const response = await fetch("localhost:8000/api/usertinknet?username="+data["username"]+"&password="+data["password"]);
        const json = await response.json();

        localStorage.setItem("token", json.token);
        window.location.reload();
    } catch(error) {
        alert(error);
    }
}
